import React, { Component } from 'react';

class Dice extends Component {
  constructor(props) {
    super(props);

    console.log(props.info.sum);
    console.log(props.info.sum2);
  }

  render() {
    return (
      <div>
        <i className={`fas fa-dice-"{this.props.info.sum}"`}></i>
        <i className={`fas fa-dice-"{this.props.info.sum2}"`}></i>
      </div>
    );
  }
}

export default Dice;
